    Lorem ipsum dolor sit amet consectetur adipisicing elit. Repellendus eligendi illum suscipit maiores voluptatem culpa, provident repudiandae quisquam dolore totam voluptatibus, magni sed eius accusamus, aut ipsam asperiores ad fuga quaerat consequatur praesentium laudantium obcaecati soluta? Pariatur odio cum eveniet illum iste quia mollitia optio molestiae omnis minus veritatis repellendus maxime excepturi itaque voluptatibus nulla vitae aut magnam, eius quaerat? Deserunt suscipit odio, harum, laboriosam optio ipsa similique at delectus nesciunt error, asperiores placeat inventore! Libero eius eaque aliquam, maiores obcaecati perferendis illo eligendi incidunt pariatur harum id, deserunt distinctio repellendus officia rem natus exercitationem quisquam sint at repudiandae beatae.
    </p>
    </div>
  )
}

export default Text;
